import React, { useRef, useState } from "react";
import "../styles/Global.css";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  ResponsiveContainer,
  RadarChart,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
  Radar,
} from "recharts";

const GraphContainer = ({ data }) => {
  const graphRef = useRef(); // הפניה לתיבת הגרפים
  const [isFullscreen, setIsFullscreen] = useState(false); // מעקב אחרי מצב המסך
  const [activeGraph, setActiveGraph] = useState("Row"); // מצב הכפתור הפעיל

  // הכנת הנתונים לפורמט Recharts
  const formattedData = Object.keys(data.SHAP).map((key) => ({
    name: key,
    SHAP: data.SHAP[key],
    FBT: data.FBT[key],
    "Logistic Regression": data["Logistic Regression"][key],
    "Decision Tree": data["Decision Tree"][key],
  }));

  // פונקציה להפעלת מסך מלא
  const handleFullscreen = () => {
    if (!isFullscreen) {
      if (graphRef.current.requestFullscreen) {
        graphRef.current.requestFullscreen();
      } else if (graphRef.current.webkitRequestFullscreen) {
        // Safari
        graphRef.current.webkitRequestFullscreen();
      } else if (graphRef.current.msRequestFullscreen) {
        // IE/Edge
        graphRef.current.msRequestFullscreen();
      }
      setIsFullscreen(true); // עדכון מצב למסך מלא
    } else {
      if (document.exitFullscreen) {
        document.exitFullscreen();
      } else if (document.webkitExitFullscreen) {
        // Safari
        document.webkitExitFullscreen();
      } else if (document.msExitFullscreen) {
        // IE/Edge
        document.msExitFullscreen();
      }
      setIsFullscreen(false); // חזרה ממצב מסך מלא
    }
  };

  // פונקציה לטיפול בלחיצה על כפתור גרף
  const handleGraphChange = (graphType) => {
    setActiveGraph(graphType);
  };

  return (
    <div className="graph-container" ref={graphRef}>
      {/* שורת כפתורים */}
      <div className="graph-buttons-container">
        <div className="graph-buttons">
          <button
            className={`graph-button ${activeGraph === "Row" ? "active" : ""}`}
            onClick={() => handleGraphChange("Row")}
          >
            Row
          </button>
          <button
            className={`graph-button ${activeGraph === "Radar" ? "active" : ""}`}
            onClick={() => handleGraphChange("Radar")}
          >
            Radar
          </button>
        </div>
        <button className="fullscreen-button" onClick={handleFullscreen}>
          {isFullscreen ? "Exit Full Screen" : "Full Screen"}
        </button>
      </div>

      {/* הצגת הגרף */}
      <div style={{ width: "100%", height: "400px" }}>
        {activeGraph === "Row" && (
          <ResponsiveContainer width="100%" height="100%">
            <BarChart data={formattedData}>
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="SHAP" fill="#8884d8" />
              <Bar dataKey="FBT" fill="#82ca9d" />
              <Bar dataKey="Logistic Regression" fill="#ffc658" />
              <Bar dataKey="Decision Tree" fill="#ff8042" />
            </BarChart>
          </ResponsiveContainer>
        )}
        {activeGraph === "Radar" && (
          <ResponsiveContainer width="100%" height="100%">
            <RadarChart data={formattedData}>
              <PolarGrid />
              <PolarAngleAxis dataKey="name" />
              <PolarRadiusAxis />
              <Radar
                name="SHAP"
                dataKey="SHAP"
                stroke="#8884d8"
                fill="#8884d8"
                fillOpacity={0.6}
              />
              <Radar
                name="FBT"
                dataKey="FBT"
                stroke="#82ca9d"
                fill="#82ca9d"
                fillOpacity={0.6}
              />
              <Radar
                name="Logistic Regression"
                dataKey="Logistic Regression"
                stroke="#ffc658"
                fill="#ffc658"
                fillOpacity={0.6}
              />
              <Radar
                name="Decision Tree"
                dataKey="Decision Tree"
                stroke="#ff8042"
                fill="#ff8042"
                fillOpacity={0.6}
              />
              <Legend />
            </RadarChart>
          </ResponsiveContainer>
        )}
      </div>
    </div>
  );
};

export default GraphContainer;
